const PhoneTablets = () => {
    return (
        <div>
            <Row>
                <Col>
                    <a href="/">
                        <span className="fa-solid fa-apple-whole"></span>
                        Phone & Tablet
                    </a>
                </Col>
            </Row>
        </div>
    )
}
export default PhoneTablets;
